import {Home} from './Components/Home'
import {Main} from './Components/Main'
import { About } from './Components/About';

function App() {
  return (
    <div className="App">
      <BrowserRouter>

      <Routes>
       <Route path = "/" element={<Main/>}/>
       <Route path = "/about" element={<About/>}/>
       <Route path = "/contact" element={<Contact/>}/>
      </Routes>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
